import cvPic from '../pictures/IMG_0041.jpg'
import React from "react";
import AppBar from '@mui/material/AppBar';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import MenuIcon from '@mui/icons-material/Menu';

const Home = () => {

    return (
        <>

    <AppBar position="fixed" color="primary" sx={{ top: 'auto', bottom: 0 }} className={'BottomBar'}>
        <Toolbar>
          <IconButton color="inherit" aria-label="open drawer" >
            <LinkedInIcon />
          </IconButton>
          <IconButton color="inherit" aria-label="open drawer" >
            <FacebookIcon />
          </IconButton>
          <IconButton color="inherit" aria-label="open drawer" >
            <InstagramIcon />
          </IconButton>
        </Toolbar>
      </AppBar>


      <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            News
          </Typography>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
    </Box>
    <div>
           <h1>Erik Torvbråten</h1>
        </div>
        <section>
            <img src={cvPic} alt="Suitpicture" width={400} height={500} />
        </section>

        <section>
            <p>My name is Erik Torvbråten and I am 21 years old. I am on my second year of a M.Sc Computer Science degree at NTNU in Trondheim.</p>
        </section>
        </>

    );
}

export default Home;
